export default theme => ({
    root: {
        flexGrow: 1,
        padding: 0
    },
    paper: {
        padding: theme.spacing(2),
        // textAlign: 'center',
        color: theme.palette.text.secondary,
    },
    spacer: {
        margin: '2% 0'
    },
    paddingClass: {
        padding: '2%'
    },
    internalPadding: {
        padding: '6% 2%'
    },
    formControl: {
        margin: theme.spacing(1),
        minWidth: '70%',
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
});
